INSERT INTO `jderobot_kids_exercise` VALUES (9,'SSPib000','SigueLíneas Pibot Simulado en Scratch','active','websim','scratch','<h1>Ejercicio SigueLíneas con Visión Artificial</h1><p> En este ejercicio tendrás que programar al PiBot para que siga una línea blanca pintada en el suelo negro.</p><p> En este caso utilizarás la cámara como <i>sensor</i>, empleando las imágenes que recoge el robot con ella (situada en la parte frontal) para filtrar la línea y así poder seguirla.</p>','','https://makers.kibotics.org/c/websim/siguelineas-pibot-scratch','thumbnail.png','{\"notebook\": \"SSPib000.xml\", \"world\":\"config_pibot.json\"}','','','',100),(11,'PRTel021','Cuadrado con Tello Real en Python','active','real','python','<h1>Cuadrado con Tello</h1><p>El objetivo de esta práctica es dibujar un cuadrado con el movimento del drone, ¡Esta vez utilizando un robot <strong>real</strong>!</p>','','https://makers.kibotics.org/c/dron-tello/ejercicio-del-cuadrado-con-python/22','thumbnail_tello.jpg','{\"world\": \"\", \"notebook\": \"PRTel021.py\",\"theory\":\"\", \"guide\":\"descarga_tello.html\"}','','','',100),(12,'SSTel001','Cuadrado con Tello Simulado en Scratch','active','websim','scratch','<h1>Cuadrado con Tello</h1><p>El objetivo de esta práctica es dibujar un cuadrado con el movimento del drone.</p>','','https://makers.kibotics.org/c/websim/cuadrado-con-tello-scratch','thumbnail.png','{\"notebook\": \"SSTel001.xml\", \"world\":\"config_tello_cuadrado.json\"}','','','',100),(13,'SSPib002','Playground Pibot Simulado en Scratch','active','websim','scratch','<h1> ¡Conoce a PiBot! </h1> <p>Este test te permitirá controlar al robot PiBot por el escenario. Investiga sus interfaces sensoriales, prueba sus motores para hacer que se mueva y a obtener las imágenes de la PiCam, ¡y mucho más!</p>','','','thumbnail.png','{\"notebook\": \"SSPib002.xml\", \"world\":\"config_pibot_playground.json\"}','','','',100),(14,'SSTel003','Playground Tello Simulado en Scratch','active','websim','scratch','<h1> ¡Prueba al drone Tello! </h1> <p>Este test te permitirá controlar a Tello por el escenario. Investiga sus interfaces sensoriales, prueba a mover al dron y a imprimir sus imágenes, ¡y mucho más!</p>','','','thumbnail.png','{\"notebook\": \"SSTel003.xml\", \"world\":\"config_tello.json\"}','','','',100),(15,'SSPib004','Sigue Pelota Pibot Simulado en Scratch','active','websim','scratch','<h1>Sigue la Pelota con PiBot utilizando Visión Artificial</h1><p>En este ejercicio tendrás que utilizar la Visión Artificial para identificar una pelota en el entorno y perseguirla.  Emplearás las imágenes obtenidas con la PiCam del robot para detectar el color de la pelota y tendrás que programar la lógica de control que te permita seguirla.</p>','','','thumbnail.png','{\"notebook\": \"SSPib004.xml\", \"world\":\"config_pibot_follow_ball.json\"}','','','',100),(16,'SSFo1005','SigueLíneas Vision F1 Simulado Scratch','active','websim','scratch','<h1>Sigue Línea con Fórmula 1</h1><p>En esta práctica tendrás que programar un fórmula 1 simulado para que siga la línea de un circuito usando la cámara integrada en el modelo.</p><p>Hacieno uso del API de la cámara tendrás que hacer girar el Fórmula 1 para que corrija la dirección y conseguir que complete el circuito.</p>','','https://makers.kibotics.org/c/websim/siguelinea-f1-vision-scratch','thumbnail.png','{\"notebook\": \"SSFo1005.xml\", \"world\":\"config_f1.json\"}','','','',100),(17,'SSPib006','SigueLíneas IR Pibot Simulado en Scratch','active','websim','scratch','<h1>Ejercicio SigueLíneas con IR</h1><p> En este ejercicio tendrás que programar al PiBot para que siga una línea negra pintada en el suelo blanco.</p><p> En cuanto a <i>sensores</i>, se usarán los dos de infrarrojos (IR) que tiene mirando al suelo.</p>','','https://makers.kibotics.org/c/websim/siguelinea-ir-pibot-scratch','thumbnail.png','{\"notebook\": \"SSPib006.xml\", \"world\":\"config_pibotIR.json\"}','','','',100),(18,'SSPib007','Choca-Gira US con Pibot en Scratch','active','websim','scratch','<h1>Ejercicio ChocaGira con US</h1><p> En este ejercicio tendrás que programar al PiBot para que avance recto mientras no tenga obstáculos delante. Si encuentra obstáculo en frente debe detenerse, retroceder un poco, girar un ángulo <i>aleatorio</i> y reemprender la marcha recta.</p><p> En cuanto a <i>sensores</i>, se usará el sonar frontal o sensor de ultra-sonidos (US).</p>','','https://makers.kibotics.org/c/websim/choca-gira-us-scrtach','thumbnail.png','{\"notebook\": \"SSPib007.xml\", \"world\":\"config_bump&go.json\"}','','','',100),(19,'SSTel008','Sigue Pelota con Tello en Scratch','active','websim','scratch','<h1>Sigue la Pelota con Tello utilizando Visión Artificial</h1><p>En este ejercicio tendrás que utilizar la Visión Artificial para resolver un problema más complejo: ¡tendrás que perseguir una pelota en movimiento! Emplearás las imágenes obtenidas por el dron con su cámara para detectar la pelota en el escenario, y tendrás que programar la lógica de control que te permita seguirla.</p>','','https://makers.kibotics.org/c/websim/sigue-pelota-tello-scratch','thumbnail.png','{\"notebook\": \"SSTel008.xml\", \"world\":\"config_tello_follow_ball.json\"}','','','',100),(20,'PRMbo009','Playground Mbot Real en Python','active','real','python','MBot dummy example','','','thumbnail_mbot.jpg','{\"world\": \"\", \"notebook\": \"PRMbo009.py\",\"theory\":\"\", \"guide\": \"descarga_mbot.html\"}','','','',100),(21,'SRTel010','Cuadrado con Tello Real en Scratch','active','real','scratch','<h1>Cuadrado con Tello</h1><p>El objetivo de esta práctica es dibujar un cuadrado con el movimento del drone, ¡Esta vez utilizando un robot <strong>real programado en Scratch</strong>!</p>','','https://makers.kibotics.org/c/dron-tello/ejercicio-del-cuadrado-con-scratch/23','thumbnail_tello.jpg','{\"notebook\": \"SRTel010.xml\", \"guide\":\"descarga_tello.html\"}','','','',100),(22,'PSPib011','Playground con Pibot Simulado en Python','active','websim','python','PyOnBrowser dummy example','','','thumbnail.png','{\"world\":\"config_pibotIR.json\", \"notebook\": \"PSPib011.py\",\"theory\":\"\" }','','','',100),(23,'SSFo1012','SigueLinea F1 Competitivo en Scratch','active','websim','scratch','<h1>SigueLinea Competitivo</h1><p>¿Crees que puedes ser el primero en completar una vuelta entera al circuito? ¡A ver quién lo consigue sin salirse de la línea!</p>','','','thumbnail_followline_competitive.png','{\"notebook\": \"SSFo1012.xml\", \"world\":\"config_competitive_followline.json\"}','{\"Competitive\":\"True\"}','','{\"code\": \"evaluator_follow_line_competitive.js\", \"icon\": [\"car1.svg\", \"car2.svg\"]}',100),(24,'SRMbo013','Playground MBot Real en Scratch','active','real','scratch','<h1>Control de Mbot Real en Scratch</h1><p>El objetivo de esta práctica es programar la lógica de control de un<strong>MBot real programado en Scratch</strong>!</p>','','','thumbnail_mbot.jpg','{\"notebook\": \"SRMbo013.xml\", \"guide\":\"descarga_mbot.html\"}','','','',100),(25,'SSFo1014','Atraviesa el Bosque Competitivo Scratch','active','websim','scratch','<h1>Atraviesa el Bosque Competitivo</h1><p>Dos robots Fórmula 1 perdidos en un bosque de obstáculos...¿Quién será el primero en sortearlos y llegar a la meta?</p>','','','thumbnail_forest_competitive.png','{\"notebook\": \"SSFo1014.xml\", \"world\": \"config_competitive_forest.json\"}','{\"Competitive\":\"True\"}','','{\"code\": \"evaluator_forest.js\", \"icon\": [\"car1.svg\", \"car2.svg\"]}',100),(26,'SSFo1015','Atraviesa el Bosque Simulado en Scratch','active','websim','scratch','<h1>Atraviesa el Bosque</h1><p>¡Ten cuidado! Tu fórmula 1 se encuentra sumido en un bosque plagado de obstáculos que debe esquivar para alcanzar la meta. ¿Cuánto tiempo tardas en atravesarlo?</p>','','','thumbnail_forest.png','{\"notebook\": \"SSFo1015.xml\", \"world\": \"config_forest.json\"}','','','',100),(27,'SSTel016','Gato-Ratón con Tello Simulado en Scratch','active','websim','scratch','<h1>Ejercicio del Gato-Ratón</h1><p>¿Conocer el juego del Gato y el Ratón? Se trata de programar la persecución del dron Ratón con tu dron Gato...¡Que no se te escape!</p>','','','thumbnail_gatoraton.png','{\"notebook\": \"SSTel016.xml\", \"world\":\"config_cat&mouse.json\"}','','','{\"code\": \"evaluator_drones.js\"}',100),(31,'PSFo1017','SigueLíneas con F1 Simulado en Python','active','websim','python','<h1>Sigue Línea con Fórmula 1 en Python</h1><p>En esta práctica tendrás que programar un fórmula 1 simulado para que siga la línea de un circuito utilizando las imágenes de su cámara.</p><p>Hacieno uso del API de la cámara tendrás que hacer girar el Fórmula 1 para que corrija la dirección y conseguir que complete el circuito. ¿Puedes hacerlo?</p>','','','thumbnail.png','{\"notebook\": \"PSFo1017.py\", \"world\":\"config_f1.json\"}','','','',100),(32,'PSThe018','Introducción al Lenguaje Python','active','pyonbrowser-theory','python','<h1>Introducción al Lenguaje Python</h1><p>Aprende las bases del leguaje de programación de alto nivel Python a través de diferentes retos y pruebas cada vez más difíciles. ¿Te atreves?</p>','','','thumbnail_introduccion_python_animated.gif','{\"notebook\": \"PSThe018.py\", \"world\": \" \"}','','','',100),(33,'SSTel020','Busca Objetos con Tello Simulado Scratch','active','websim','scratch','<h1>Ejercicio del Dron Busca Objetos en Scratch</h1><p>El dron Tello está rodeado de varios objetos de colores y equipado con una cámara capaz de detectarlos. Para encontrar cada objeto el dron debe acercarse a él. ¿Cuántos eres capaz de localizar?</p>','','','thumbnail.png','{\"notebook\": \"SSTel020.xml\", \"world\":\"config_tello_search_object.json\"}','','','',100),(34,'SSTel019','SigueLíneas con Tello Simulado Scratch','active','websim','scratch','<h1>Ejercicio del Dron sigue Líneas en Scratch</h1><p>En este ejercicio deberás seguir la carretera que está debajo del dron Tello para completar una vuelta al circuito. ¡A ver cuán rápido puedes hacerlo!</p>','','','thumbnail.png','{\"notebook\": \"SSTel019.xml\", \"world\":\"config_tello_follow_line.json\"}','','','',100),(35,'PSTel027','Busca Objetos con Tello Simulado Python','active','websim','python','<h1>Ejercicio del Dron Busca Objetos en Python</h1><p>El dron Tello está rodeado de varios objetos de colores y equipado con una cámara capaz de detectarlos. Para encontrar cada objeto el dron debe acercarse a él. ¿Cuántos eres capaz de localizar?</p>','','','thumbnail.png','{\"notebook\": \"PSTel027.py\", \"world\":\"config_tello_search_object.json\"}','','','',100),(36,'PSTel026','SigueLíneas con Tello Simulado Python','active','websim','python','<h1>Ejercicio del Dron sigue Líneas en Python</h1><p>En este ejercicio deberás seguir la carretera que está debajo del dron Tello para completar una vuelta al circuito. ¡A ver cuán rápido puedes hacerlo!</p>','','','thumbnail.png','{\"notebook\": \"PSTel026.py\", \"world\":\"config_tello_follow_line.json\"}','','','',100),(37,'PSPib025','Choca-Gira US con Pibot en Python','active','websim','python','<h1>Ejercicio Choca-Gira US con Pibot en Python</h1><p>El robot Pibot se encuentra en una habitación llena de obstáculos por la que tiene que navegar, haciendo uso de su sensor de Ultrasonidos para detectar los obstáculos y ejecutar un giro. ¿Cuánto tiempo puedes aguantar sin chocar?</p>','','','thumbnail.png','{\"notebook\": \"PSPib025.py\", \"world\":\"config_bump&go.json\"}','','','',100),(38,'PSTel024','Gato-Ratón con Tello Simulado en Python','active','websim','python','<h1>Ejercicio del Gato-Ratón</h1><p>¿Conocer el juego del Gato y el Ratón? Se trata de programar la persecución del dron Ratón con tu dron Gato...¡Que no se te escape!</p>','','','thumbnail.png','{\"notebook\": \"PSTel024.py\", \"world\":\"config_cat&mouse.json\"}','','','',100),(39,'PSPib023','Sigue Pelota Pibot Simulado en Python','active','websim','python','<h1>Sigue la Pelota con PiBot utilizando Visión Artificial</h1><p>En este ejercicio tendrás que utilizar la Visión Artificial para identificar una pelota en el entorno y perseguirla.  Emplearás las imágenes obtenidas con la PiCam del robot para detectar el color de la pelota y tendrás que programar la lógica de control que te permita seguirla.</p>','','','thumbnail.png','{\"notebook\": \"PSPib023.py\", \"world\":\"config_pibot_follow_ball.json\"}','','','',100),(40,'PSPib022','SigueLíneas IR Pibot Simulado en Python','active','websim','python','<h1>Ejercicio SigueLíneas con IR</h1><p> En este ejercicio tendrás que programar al PiBot para que siga una línea negra pintada en el suelo blanco.</p><p> En cuanto a <i>sensores</i>, se usarán los dos de infrarrojos (IR) que tiene mirando al suelo.</p>','','','thumbnail.png','{\"notebook\": \"PSPib022.py\", \"world\":\"config_pibotIR.json\"}','','','',100);
